import requests

url = "https://tik-tok-feed.p.rapidapi.com/collection/"
querystring = {"cursor": cursor, "type": type, "collectionId": collectionid}

headers = {
    "X-RapidAPI-Key": "SIGN-UP-FOR-KEY",
    "X-RapidAPI-Host": "tik-tok-feed.p.rapidapi.com"
}

response = requests.get(url, headers=headers, params=querystring)

print(response.json())

